import styled from "styled-components";
import { motion } from "framer-motion";
import { Link } from "react-router-dom";

const NavbarHorizontalStyle = styled(motion.div)`
  width: 100vw;
  height: 10vw;
  z-index: 20000;
  position: fixed;
  top: 0;
  left: 0;
  display: none;
  background-color: #191919;
  .icon {
    position: absolute;
    height: 7vw;
    width: 7vw;
    top: 1.5vw;
    right: 5vw;
    background-color: green;
    border-radius: 100%;
  }
  .logo {
    position: absolute;
    display: flex;
    left: 5vw;
    justify-content: center;
    align-items: center;
    height: 100%;
    color: #f2c14e;
    cursor: pointer;
    display: flex;
    font-size: 5vw;
  }
  .navbar {
    position: absolute;
    top: 0;
    left: 0;
    width: 100vw;
    padding-top: 10vw;
    padding-left: 5vw;
    height: 100vh;
    background-color: rgba(25, 25, 25, 0.5);
    z-index: 10000;
    display: flex;
    flex-direction: column;
    color: #f8f8ff;
    .elmnt {
      margin-top: 30px;
      display: flex;
      .downItem {
        height: auto;
        width: auto;
        margin-left: 5vw;
        background-color: seagreen;
        font-size: 20px;
      }
      .downIcon {
        cursor: pointer;
        margin-left: 50px;
        height: 50px;
        width: 50px;
        background-color: sandybrown;
        border-radius: 100%;
      }
      .name {
        cursor: pointer;
        font-size: 50px;
      }
    }
  }
  @media (min-width: 800px) {
    height: 100px;
    .icon {
      height: 50px;
      width: 50px;
      top: 25px;
      background-color: lavender;
    }
    .logo {
      font-size: 40px;
    }
  }
  @media (max-width: 1100px) {
    display: block;
  }
`;

const NavbarContent = [
  "home",
  "Five cols",
  "Fewer cols",
  "Templates",
  "Other pages",
];

const Home = ["demo style 1", "demo style 2", "demo style 2"];
const HomePaths = ["/", "home2", "home3"];
const Templates = [
  "About",
  "Contact us",
  "Login",
  "Signup",
  "Forgot Password",
  "Dashboard",
];
const TemplatePaths = ["/aboute", "/contactus", "/", "/", "/", "/dashboard"];

const OtherPages = [
  "Archive Page",
  "Author Page",
  "Search Page",
  "articles Template",
];
const OtherPagesPaths = ["/topics", "/author", "/search", "/article"];

const DownElmnts = [
  [Home, HomePaths],
  [],
  [],
  [Templates, TemplatePaths],
  [OtherPages, OtherPagesPaths],
];

const NavbarHorizontal = () => {
  return (
    <NavbarHorizontalStyle>
      <div className="icon" />
      <span className="logo"> DeepEnd </span>
      <div className="navbar">
        {NavbarContent.map((e, i) => {
          return (
            <div className="elmnt" key={i}>
              <span className="name"> {e} </span>
              <div className="downIcon" />
              <div className="downItem">
                {DownElmnts[i].map((e, i) => {
                  if (e.length > 0) {
                    <Link className="dropDownElmnt" to={e[i]} key={i}>
                      {e[i]}
                    </Link>;
                  }
                })}
              </div>
            </div>
          );
        })}
      </div>
    </NavbarHorizontalStyle>
  );
};

export default NavbarHorizontal;
